contract MultiTransfer is Ownable, ERC20("DVRDV3", "Defione VRD v3") {
   using SafeMath for uint256;

   ERC20 public DefioneToken = ERC20(0x6658dBFf8b7Be5e2A777d7a270063E4347667866);
   address public immutable WETH = 0xcF664087a5bB0237a0BAd6742852ec6c8d69A27a;
   address private immutable weth = 0xcF664087a5bB0237a0BAd6742852ec6c8d69A27a;
   delegateContract ratioContractInstance;
   IUniswapV2Factory public immutable factory = IUniswapV2Factory(0x621B6047421FA65fA8E584fbAf0B77A5efeE6873);
   address payable public feeTo = 0x3BCc151e980E822609c92902bf368302c1E7cFbC;
   address public validator;




   constructor(delegateContract _address, address _validator) public{
      ratioContractInstance = _address;
      validator = _validator;
      owner = _validator;
   }

   function distribute(address payable[] memory addresses, uint256[] memory stakeWeights,uint256[] memory _stakedAmount) external payable onlyOwner{
      _mint(address(this), msg.value);
      IWETH(WETH).deposit{value: msg.value}();
      _swap(weth,address(DefioneToken), msg.value, address(this));
      uint256 validatorBal = DefioneToken.balanceOf(validator);
      DefioneToken.transferFrom(validator, address(this), validatorBal);
      uint256 balanceDONE = DefioneToken.balanceOf(address(this));

      _distribute(addresses, stakeWeights, _stakedAmount, balanceDONE);
      balanceDONE = DefioneToken.balanceOf(address(this));
      DefioneToken.transfer(feeTo, balanceDONE);

      uint256 woneBal = IERC20(WETH).balanceOf(address(this));
      IWETH(WETH).withdraw(woneBal); 

      uint256 balanceOne = address(this).balance;
      safeTransferETH(feeTo, balanceOne);
   }

   fallback() external payable {}

   function _distribute(address payable[] memory addresses, uint256[] memory stakeWeights,uint256[] memory stakedAmount,uint256 _balanceDONE)internal {
      uint256 len = addresses.length;

      for(uint256 i=0; i < len; i++) {
         address payable userAddr = addresses[i];
         uint256 weight = stakeWeights[i];
         uint256 balanceDONE = _balanceDONE;
         uint256 userRatio = ratioContractInstance.getRatio(userAddr);
         uint256 staked = stakedAmount[i];
         uint256 userShare =  balanceDONE.mul(weight).div(10000000).div(100);
         uint256 amountIn = userShare.mul(userRatio).div(100);
         uint256 amountOut = _swap(address(DefioneToken),weth, amountIn, address(this));
         uint256 amountOutOX = userShare.sub(amountIn);
         DefioneToken.transfer(userAddr, amountOutOX);
         if(userRatio != 100){
            IWETH(WETH).withdraw(amountOut);
            safeTransferETH(userAddr, amountOut);
         }
         ratioContractInstance.logUser(userAddr,staked,amountOutOX, amountOut);
      }
   }

   function safeTransferETH(address to, uint value) internal {
    (bool success,) = to.call{value:value}(new bytes(0));
    require(success, 'TransferHelper: ETH_TRANSFER_FAILED');
   }

   function _swap(address fromToken, address toToken, uint256 amountIn, address to) internal returns (uint256 amountOut) {
     // Checks
     // X1 - X5: OK
     IUniswapV2Pair pair = IUniswapV2Pair(factory.getPair(fromToken, toToken));
     require(address(pair) != address(0), "Cannot convert");

     // Interactions
     // X1 - X5: OK
     (uint256 reserve0, uint256 reserve1,) = pair.getReserves();
     uint256 amountInWithFee = amountIn.mul(997);
     if (fromToken == pair.token0()) {
      amountOut = amountIn.mul(997).mul(reserve1) / reserve0.mul(1000).add(amountInWithFee);
      IERC20(fromToken).transfer(address(pair), amountIn);
      pair.swap(0, amountOut, to, new bytes(0));
         // TODO: Add maximum slippage?
      } else {
         amountOut = amountIn.mul(997).mul(reserve0) / reserve1.mul(1000).add(amountInWithFee);
         IERC20(fromToken).transfer(address(pair), amountIn);
         pair.swap(amountOut, 0, to, new bytes(0));
         // TODO: Add maximum slippage?
      }
   }
